import React from "react";
import "./Home.scss"
import Header from "../components/Header";
import headshot from "../imgs/headshot.jpg"

export default function Home() {

  return (
    <div className="home mx-auto" id="home">
      <Header title={"Welcome!"} caption={"Hi, thanks for visiting my online portfolio!  My name is Colbe Roberson.  I'm currently a computer science student at the New Jersey Institute of Technology.  I hope that through this website you can learn more about the work I've done in programming and computer science."}/>
      <img src={headshot} className="mx-auto headshot" />
    </div>
  )
}
